CREATE TABLE `admin_notification` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `message` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `read_status` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `admin_notification` (`id`,`message`,`created_at`,`read_status`) VALUES ('1','Tutor user Nina  Oporto has been registered','2024-02-18 19:37:07','1');
INSERT INTO `admin_notification` (`id`,`message`,`created_at`,`read_status`) VALUES ('2','Student user Edrick Windell has been registered','2024-02-18 19:37:07','1');
