CREATE TABLE `tutorial_application` (
  `application_id` int(11) NOT NULL AUTO_INCREMENT,
  `job_id` int(20) NOT NULL,
  `module_id` int(20) NOT NULL,
  `tutor_id` int(20) NOT NULL,
  `student_id` int(20) NOT NULL,
  `modoftutoring` varchar(255) NOT NULL,
  `parentcontact` varchar(255) NOT NULL,
  `learningdisabilities` varchar(255) NOT NULL,
  `additionalcomment` varchar(255) NOT NULL,
  `paymentStatus` varchar(255) NOT NULL DEFAULT 'Unpaid',
  `applicationStatus` varchar(255) NOT NULL DEFAULT 'Pending',
  `date_applied` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`application_id`),
  KEY `job_id` (`job_id`),
  KEY `module_id` (`module_id`),
  KEY `tutor_id` (`tutor_id`),
  KEY `student_id` (`student_id`),
  CONSTRAINT `tutorial_application_ibfk_1` FOREIGN KEY (`module_id`) REFERENCES `tutorial_module` (`module_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `tutorial_application_ibfk_2` FOREIGN KEY (`tutor_id`) REFERENCES `tutor` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `tutorial_application_ibfk_3` FOREIGN KEY (`student_id`) REFERENCES `student` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `tutorial_application_ibfk_4` FOREIGN KEY (`job_id`) REFERENCES `tutorial_services` (`job_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `tutorial_application` (`application_id`,`job_id`,`module_id`,`tutor_id`,`student_id`,`modoftutoring`,`parentcontact`,`learningdisabilities`,`additionalcomment`,`paymentStatus`,`applicationStatus`,`date_applied`) VALUES ('1','1','1','1','1','N/A','N/A','N/A','N/A\r\n','Unpaid','Ongoing','2024-02-19 00:03:05');
INSERT INTO `tutorial_application` (`application_id`,`job_id`,`module_id`,`tutor_id`,`student_id`,`modoftutoring`,`parentcontact`,`learningdisabilities`,`additionalcomment`,`paymentStatus`,`applicationStatus`,`date_applied`) VALUES ('2','1','1','1','2','1','1','1','1\r\n','Unpaid','Archived','2024-02-19 00:03:05');

CREATE TABLE `tutorial_module` (
  `module_id` int(11) NOT NULL AUTO_INCREMENT,
  `job_id` int(50) NOT NULL,
  `module_title` varchar(255) NOT NULL,
  `module_description` text NOT NULL,
  `module_posted` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`module_id`),
  KEY `job_id` (`job_id`),
  CONSTRAINT `tutorial_module_ibfk_1` FOREIGN KEY (`job_id`) REFERENCES `tutorial_services` (`job_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `tutorial_module` (`module_id`,`job_id`,`module_title`,`module_description`,`module_posted`) VALUES ('1','1','Piano Basic','Piano Lesson ','2024-02-18 19:39:38');

CREATE TABLE `tutorial_module_files` (
  `file_id` int(11) NOT NULL AUTO_INCREMENT,
  `module_id` int(11) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `status` varchar(255) NOT NULL DEFAULT 'Pending',
  `file_name` varchar(255) NOT NULL,
  `file_type` varchar(55) NOT NULL,
  `file_path` varchar(255) NOT NULL,
  PRIMARY KEY (`file_id`),
  KEY `module_id` (`module_id`),
  CONSTRAINT `tutorial_module_files_ibfk_1` FOREIGN KEY (`module_id`) REFERENCES `tutorial_module` (`module_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `tutorial_schedule` (
  `sched_id` int(11) NOT NULL AUTO_INCREMENT,
  `job_id` int(50) NOT NULL,
  `day` varchar(255) NOT NULL,
  `starttime` time NOT NULL,
  `endtime` time NOT NULL,
  PRIMARY KEY (`sched_id`),
  KEY `job_id` (`job_id`),
  CONSTRAINT `tutorial_schedule_ibfk_1` FOREIGN KEY (`job_id`) REFERENCES `tutorial_services` (`job_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `tutorial_schedule` (`sched_id`,`job_id`,`day`,`starttime`,`endtime`) VALUES ('1','1','Monday','08:00:00','17:00:00');

CREATE TABLE `tutorial_services` (
  `job_id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(255) NOT NULL,
  `subject` varchar(255) NOT NULL,
  `tutor_id` int(50) NOT NULL,
  `title` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `rate2` varchar(255) NOT NULL,
  `rate1` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL DEFAULT 'Available',
  `date_posted` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `mop` varchar(255) NOT NULL,
  `accountnumber` varchar(255) NOT NULL,
  PRIMARY KEY (`job_id`),
  KEY `user_id` (`tutor_id`),
  CONSTRAINT `tutorial_services_ibfk_1` FOREIGN KEY (`tutor_id`) REFERENCES `tutor` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
INSERT INTO `tutorial_services` (`job_id`,`category`,`subject`,`tutor_id`,`title`,`description`,`rate2`,`rate1`,`status`,`date_posted`,`mop`,`accountnumber`) VALUES ('1','',' Music','1','Piano Lesson','Face to face piano lesson with me, mario!','1000','200','Ongoing','2024-02-19 00:02:15','Gcash','09138192839');

CREATE TABLE `tutorial_services_review` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `job_id` int(100) NOT NULL,
  `student_id` int(11) NOT NULL,
  `comment` text NOT NULL,
  `stars` int(100) NOT NULL,
  `date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `job_id` (`job_id`),
  KEY `student_id` (`student_id`),
  CONSTRAINT `tutorial_services_review_ibfk_1` FOREIGN KEY (`job_id`) REFERENCES `tutorial_services` (`job_id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `tutorial_services_review_ibfk_2` FOREIGN KEY (`student_id`) REFERENCES `student` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `tutor_notification` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `message` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `read_status` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `tutor_notification_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `tutor` (`user_id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
